import React from 'react';
// UploadPage.js

// Importing CSS files with corrected paths
import '../css/back-to-top.css';          // Correct path
import '../css/predictor.css';            // Correct path
import '../css/styles-merged.css';        // Correct path
import '../../css/style.min.css';            // Correct path
import '../../css/style.css';                // Correct path
import '../../css/default-skin/default-skin.css';  // Correct path

// Your JavaScript code here
// Import your CSS files
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
    const previewImage = (event) => {
        const image = document.getElementById('uploadedImage');
        const file = event.target.files[0];
        if (file) {
            const reader = new FileReader();
            reader.onload = (e) => {
                image.src = e.target.result;
                image.style.display = 'block';
                document.getElementById('processButton').style.display = 'block';
            };
            reader.readAsDataURL(file);
        } else {
            image.src = "#";
            image.style.display = 'none';
            document.getElementById('processButton').style.display = 'none';
        }
    };

    const uploadAndProcessImage = async () => {
        const formData = new FormData();
        const fileInput = document.getElementById('imageInput');
        if (fileInput.files.length === 0) {
            alert("Please upload an image before processing.");
            return;
        }

        formData.append('image', fileInput.files[0]);

        try {
            const response = await fetch('/process_image', {
                method: 'POST',
                body: formData,
            });

            if (response.ok) {
                const result = await response.json();
                alert("Image processed successfully! Result: " + result.message);
            } else {
                alert("Error processing the image.");
            }
        } catch (error) {
            console.error("Error:", error);
            alert("An error occurred while processing the image.");
        }
    };

    return (
        <div>
            <nav className="navbar navbar-default probootstrap-navbar">
                <div className="container">
                    <div className="navbar-header">
                        <button
                            className="navbar-toggle collapsed"
                            data-toggle="collapse"
                            data-target="#navbar-collapse"
                            aria-expanded="false"
                            aria-controls="navbar"
                        >
                            <span className="sr-only">Toggle navigation</span>
                            <span className="icon-bar"></span>
                            <span className="icon-bar"></span>
                            <span className="icon-bar"></span>
                        </button>
                        <a className="navbar-brand" href="/">Cattle Disease Analysis & Prediction</a>
                    </div>
                    <div className="collapse navbar-collapse" id="navbar-collapse">
                        <ul className="nav navbar-nav navbar-right">
                            <li className="active"><a href="#">Home</a></li>
                            <li><a href="#features">About us</a></li>
                            <li><a href="#predict">Predict</a></li>
                            <li><a href="#analysis">Preventive Measures</a></li>
                            <li><a href="#contact">Feedback</a></li>
                        </ul>
                    </div>
                </div>
            </nav>

            <section
                className="probootstrap-hero probootstrap-slant"
                id="home"
                style={{ backgroundImage: 'url(https://www.grandmasterglobal.com/blog/wp-content/uploads/2024/03/ai-cowbreeding-1000x560.jpeg)' }}
            >
                <div className="container">
                    <div className="row intro-text">
                        <div className="col-md-8 col-md-offset-2 text-center">
                            <h1 style={{ color: '#E0F7FA' }}>Early detection saves lives – and livelihoods</h1>
                            <div className="probootstrap-subheading center">
                                <p>
                                    <a className="btn btn-primary" href="#predict" role="button">Check Now</a>
                                    <a className="btn btn-default" href="#analysis" role="button">See Analysis</a>
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            </section>

            <button
                className="btn btn-primary"
                id="backToTopBtn"
                onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
                title="Go to top"
            >
                <span className="icon icon-align-top"></span>
            </button>

            <section id="features" className="probootstrap-section probootstrap-bg-light">
                <div className="container">
                    <div className="row text-center mb100">
                        <div className="col-md-8 col-md-offset-2">
                            <h2>About us</h2>
                            <p>
                                We are dedicated to revolutionizing livestock health management through cutting-edge technology. Our mission is to empower farmers, veterinarians, and agricultural stakeholders with advanced tools to predict, prevent, and manage diseases in cattle.
                            </p>
                        </div>
                    </div>
                </div>
            </section>

            <section id="predict" className="probootstrap-section">
                <div className="container">
                    <div className="row text-center mb100">
                        <div className="col-md-8 col-md-offset-2">
                            <h2>Predict the disease</h2>
                            <p>Provide the proper image.</p>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-md-6 col-md-offset-3" style={{ textAlign: 'center' }}>
                            <form id="imageUploadForm" encType="multipart/form-data">
                                <input
                                    type="file"
                                    id="imageInput"
                                    name="image"
                                    accept="image/*"
                                    onChange={previewImage}
                                />
                            </form>
                            <div id="imagePreview" style={{ marginTop: '20px' }}>
                                <img
                                    id="uploadedImage"
                                    src="#"
                                    alt="Image Preview"
                                    style={{ maxWidth: '100%', display: 'none' }}
                                />
                            </div>
                            <div id="processButton" style={{ marginTop: '20px', display: 'none' }}>
                                <button className="btn btn-primary" onClick={uploadAndProcessImage}>
                                    Process Image
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            </section>

            <section id="analysis" className="probootstrap-section probootstrap-bg-light">
                <div className="container">
                    <div className="row text-center mb100">
                        <div className="col-md-8 col-md-offset-2">
                            <h2>Preventive Measures</h2>
                            <ul>
                                <li>Vaccination and Disease Prevention</li>
                                <li>Balanced Nutrition</li>
                                <li>Hygiene and Housing</li>
                                <li>Parasite Control</li>
                                <li>Regular Health Monitoring</li>
                            </ul>
                        </div>
                    </div>
                </div>
            </section>

            <section id="contact" className="probootstrap-section">
                <div className="container">
                    <div className="row">
                        <div className="col-md-6">
                            <form className="probootstrap-form">
                                <h2>Get In Touch</h2>
                                <div className="form-group">
                                    <input type="text" className="form-control" placeholder="Your Name" />
                                </div>
                                <div className="form-group">
                                    <input type="number" className="form-control" placeholder="Your Phone" />
                                </div>
                                <div className="form-group">
                                    <textarea className="form-control" cols="30" rows="10" placeholder="Write a Message"></textarea>
                                </div>
                                <div className="form-group">
                                    <input type="submit" className="btn btn-primary" value="Send Message" />
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
};

export default App;
